import React from "react";
import { EffectBg } from "../Template.js";

export const StartBtn = () => {
  
  return (
    <EffectBg>
      <h4>Start!</h4>
    </EffectBg>
  );
};

export const AccountBtn = () => {
  return (
    <EffectBg>
      <h4 style={{ fontSize: "1.2rem" }}> 회원가입/로그인 </h4>
    </EffectBg>
  );
};
